--
-- Create index `curso_acta` on table `Acta`
--
ALTER TABLE Acta
ADD UNIQUE INDEX curso_acta (curso_acta);

--
-- Create foreign key
--
ALTER TABLE Acta
ADD CONSTRAINT Acta_ibfk_1 FOREIGN KEY (curso_acta)
REFERENCES Curso (id_curso);

--
-- Create table `ItemActa`
--
CREATE TABLE IF NOT EXISTS ItemActa (
  id_itemActa int NOT NULL AUTO_INCREMENT,
  acta_itemActa int NOT NULL,
  estudiante_itemActa int NOT NULL,
  promedioCalificaciones_itemActa decimal(4, 2) NOT NULL,
  promedioAsistencias_itemActa int NOT NULL,
  estado_itemActa varchar(100) NOT NULL,
  PRIMARY KEY (id_itemActa)
)
ENGINE = INNODB,
AUTO_INCREMENT = 91,
AVG_ROW_LENGTH = 182,
CHARACTER SET utf8mb4,
COLLATE utf8mb4_0900_ai_ci;

--
-- Create check constraint
--
ALTER TABLE ItemActa
ADD CONSTRAINT ItemActa_chk_1 CHECK ((`promedioCalificaciones_itemActa` >= 0) AND (`promedioCalificaciones_itemActa` <= 10));

--
-- Create check constraint
--
ALTER TABLE ItemActa
ADD CONSTRAINT ItemActa_chk_2 CHECK ((`promedioAsistencias_itemActa` > 0) AND (`promedioAsistencias_itemActa` <= 100));

--
-- Create check constraint
--
ALTER TABLE ItemActa
ADD CONSTRAINT ItemActa_chk_3 CHECK (`estado_itemActa` IN (_utf8mb4 'Aprobado', _utf8mb4 'Reprobado'));

--
-- Create index `acta_itemActa` on table `ItemActa`
--
ALTER TABLE ItemActa
ADD UNIQUE INDEX acta_itemActa (acta_itemActa, estudiante_itemActa);

--
-- Create foreign key
--
ALTER TABLE ItemActa
ADD CONSTRAINT ItemActa_ibfk_1 FOREIGN KEY (acta_itemActa)
REFERENCES Acta (id_acta);

--
-- Create foreign key
--
ALTER TABLE ItemActa
ADD CONSTRAINT ItemActa_ibfk_2 FOREIGN KEY (estudiante_itemActa)
REFERENCES Estudiante (id_estudiante);

