USE CENTROARTESANAL;

DELIMITER $$

--
-- Create trigger `insertar_entregas`
--
CREATE
DEFINER = 'root'@'%'
TRIGGER insertar_entregas
AFTER INSERT
ON Actividad
FOR EACH ROW
BEGIN
    SELECT
      NEW.id_actividad,
      Matricula.estudiante_matricula
    FROM Matricula
      JOIN ItemMatricula
        ON Matricula.id_matricula = ItemMatricula.matricula_itemMatricula
    WHERE curso_itemMatricula = NEW.curso_actividad;
END
$$

DELIMITER ;

